export default (function(a,b){return {data:{YESBRj8tVr:{data:{id:598,attributes:{imdbId:"tt0032336",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMjY5MmY4YWMtZDk1Yy00MTBlLWI5ZjctZDU1ZmUyNzA2ZTg3XkEyXkFqcGdeQXVyMDMxMjQwMw@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"5.7\u002F10"}],item_lang:{data:{id:1261,attributes:{title:"Chip of the Flying U",plot:"Duncan is secretly shipping explosives by ship and needs the Flying U ranch which has shore access. Chip breaks up his murder and robbery attempts and eventually captures two of his henchman. Duncan has to show his hand to rescue his men and now Chip and the posse know who they are after.",slug:"chip-of-the-flying-u"}}},books:{data:[{id:681,attributes:{title:"Making News at The New York Times",description:"An ethnographic study of The New York Times' business desk provides a unique vantage point to see the future for news in the digital age.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=eA1rAwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Nikki Usher"],firstBook:true,published:"2014-04-24",publisher:"University of Michigan Press",subtitle:a}},{id:682,attributes:{title:"The Adventures of Tom Sawyer Illustrated",description:"\"The Adventures of Tom Sawyer by Mark Twain is an 1876 novel about a young boy growing up along the Mississippi River. It is set in the 1840 in the fictional town of St. Petersburg, inspired by Hannibal, Missouri, where Twain lived as a boy. In the novel Tom Sawyer has several adventures, often with his friend Huckleberry Finn. Originally a commercial failure, the book ended up being the best selling of any of Twain's works during his lifetime.Though overshadowed by its sequel, Adventures of Huckleberry Finn, the book is by many considered a masterpiece of American literature, and was one of the first novels to be written on a typewriter.\"",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=hjgszgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Mark Twain"],firstBook:b,published:"2021-01-23",publisher:"Independently Published",subtitle:a}},{id:683,attributes:{title:"Who Was Mark Twain?",description:"A humorist, narrator, and social observer, Mark Twain is unsurpassed in American literature. Best known as the author of The Adventures of Huckleberry Finn, Mark Twain, not unlike his protagonist, Huck, has a restless spirit. He found adventure prospecting for silver in Nevada, navigating steamboats down the Mississippi, and making people laugh around the world. But Twain also had a serious streak and decried racism and injustice. His fascinating life is captured candidly in this enjoyable biography.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=zgiASzKKsPAC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["April Jones Prince","Who HQ"],firstBook:b,published:"2004-05-24",publisher:"Penguin",subtitle:a}},{id:684,attributes:{title:"Science in Action",description:"From weaker to stronger rhetoric : literature - Laboratories - From weak points to strongholds : machines - Insiders out - From short to longer networks : tribunals of reason - Centres of calculation.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=sC4bk4DZXTQC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Bruno Latour"],firstBook:b,published:"1987-01-01",publisher:"Harvard University Press",subtitle:"How to Follow Scientists and Engineers Through Society"}},{id:685,attributes:{title:"Racism and Anti-Racism in Football",description:"This book explores the key issues of racism, anti-racism and identity in British football. It relates the history of black players in the game, analyses the racism they have experienced, and evaluates the efficacy of anti-racist campaigns. The efficacy of the policing of racism is also assessed. The nationalism and xenophobia evident in much of the media's coverage of major tournaments is highlighted in the context of the way that English, Scottish and Welsh identities are constructed within British football.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=O7WDDAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Jon Garland","Michael Rowe"],firstBook:b,published:"2001-08-24",publisher:"Springer",subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940942461}}("",null))